import logo from './logo.svg';
import './App.css';

const App = () => {
   return (
       <div className='App'>
           <Header />
        <ul>
            <li>css</li>
            <li>html</li>
            <li>js</li>
            <li>react</li>
        </ul>
       </div>
   );
}

const Header = () => {
    return (
        <div>
            <a href='#'>Home</a><br/>
            <a href='#'>New Feed</a><br/>
            <a href='#'>Messages</a>
        </div>
    );
}

export default App;
